let fileName;
let synopticArr, snakeArr;
cy.removeDownloadsFiles();
cy.synopticRun({
  language: 'Hebrew',
  files: ['tehilim1mechon-mamre.txt', 'tehilim1chabad.txt']
});
cy.enterEmail();
cy.downloadEmailResultsFile({
  vertical: 'horiz'
}).then(() => {
  cy.fileName().then(name => {
    fileName = name;
  });
}).then(() => {
  cy.readExcelFile(fileName)
  // returns an array of lines read from Excel file
  .then(list => {
    synopticArr = list;
  }).then(() => {
    cy.moveFileDownloadsTofixtures(fileName).then(() => {
      cy.setLanguageMode({
        language: 'Hebrew'
      });
      cy.runSnake({
        file: fileName,
        numColumnsPerRow: undefined,
        blankRows: undefined,
        includeSynopsisSnakeFile: true
      });
    }).then(() => {
      cy.getSnakeMatrix().then(matrix => {
        snakeArr = matrix;
      });
    }).then(() => {
      cy.snakeHasSameData({
        synopticArr: synopticArr,
        snakeArr: snakeArr,
        blankRows: 2,
        columnsPerRow: 10,
        numBooks: 2,
        synopsis: true
      });
    });
  });
});
